struct SAYGestureTemplateCGFloat {
    
    let shortNodUpandBack = convertStringtoTemplate(SAYGestureTemplateString().shortNodUpandBack)
    
    let LongNodStartUp = convertStringtoTemplate(SAYGestureTemplateString().LongNodStartUp)
    
    let longNodStartDown = convertStringtoTemplate(SAYGestureTemplateString().longNodStartDown)
    
    let shortNodDownandBack = convertStringtoTemplate(SAYGestureTemplateString().shortNodDownandBack)
    
    let lookLeftandBack = convertStringtoTemplate(SAYGestureTemplateString().lookLeftandBack)
    
    let lookRightandBack = convertStringtoTemplate(SAYGestureTemplateString().lookRightandBack)
    
    let shakeHeadStartLeft = convertStringtoTemplate(SAYGestureTemplateString().shakeHeadStartLeft)
    
    let shakeHeadStartRight = convertStringtoTemplate(SAYGestureTemplateString().shakeHeadStartRight)
    
    let tiltLeftandBack = convertStringtoTemplate(SAYGestureTemplateString().tiltLeftandBack)
    
    let tiltRightandBack = convertStringtoTemplate(SAYGestureTemplateString().tiltRightandBack)
    
    let twistLeftandBack = convertStringtoTemplate(SAYGestureTemplateString().twistLeftandBack)
    
    let twistRightandBack = convertStringtoTemplate(SAYGestureTemplateString().twistRightandBack)
    
    let jerkBack = convertStringtoTemplate(SAYGestureTemplateString().jerkBack)
    
}


func convertStringtoTemplate(string: String) -> [SAY3DPoint] {
    let arrayRaw = string.componentsSeparatedByString("]")
    var arrayCleaned = [String]()
    for item in arrayRaw {
        arrayCleaned.append(item.stringByReplacingOccurrencesOfString("[", withString: "").stringByReplacingOccurrencesOfString("]", withString: ""))
    }
    var arrayNoCommas = [String]()
    for item in arrayCleaned {
        let temp = item.componentsSeparatedByString(",")
        arrayNoCommas = arrayNoCommas + temp
    }
    
    for var i = 0; i < arrayNoCommas.count; i++ {
        if arrayNoCommas[i] == "nil" || arrayNoCommas[i] == "" || arrayNoCommas[i] == " " {
            arrayNoCommas.removeAtIndex(i)
            i = i - 1  //account for removal of item
        }
    }
    
    var say3DPoints = [SAY3DPoint]()
    while arrayNoCommas.count >= 3 {
        let z = (arrayNoCommas.popLast()! as NSString).floatValue
        let y = (arrayNoCommas.popLast()! as NSString).floatValue
        let x = (arrayNoCommas.popLast()! as NSString).floatValue
        
        say3DPoints.append(SAY3DPoint(x: CGFloat(x), y: CGFloat(y), z: CGFloat(z)))
        say3DPoints = say3DPoints.reverse()
        
    }
    
    return say3DPoints
}

